import './TodoCounter.css';

function TodoCounter({total, completed}){
  const messageCompleted = `You have shopped for <span>{completed} </span>out of <span>{total}</span> groceries.`
  const meesageFinished  = 'Congratulation you have shop all' 
  const msn = (completed === total ) ? meesageFinished : messageCompleted;
  return (
      <><h1 className='Title green'> Shopping List</h1>
            <h2 className='Title marron'>
                    {msn}
            </h2>
      </>

    );
  }

  export { TodoCounter };
